    GLB.PASSWORD = pPassword;
    GLB.AUDITJOB = pAuditJob;
    GLB.AUDITACT = pAuditAct;
    GLB.FILESDIR = pFilesDir;
    GLB.AUDITDIR = pAuditDir;
    GLB.BACKUPDIR = pBackupDir;
